import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
const App = () => {
  return (
    <div>
      <Router>
        <Switch>
          <Route>
            <Link>Home</Link>
            About
          </Route>
        </Switch>
      </Router>
    </div>
  );
};

export default App;
